import React from "react"
import ReactSampleCode from "./../../docList/ReactSampleCode";

const returnParsedFile = file => {
    let contentFromFile = new FileReader;
    console.log(contentFromFile.readAsText(file))
    return contentFromFile.readAsText(file)
}

export default returnParsedFile;
